import React from 'react'
import './Footer.css'

function Footer() {
    return (
        <footer id="footer" className="footer">            
            <p>
                Made with ❤ by :-
                <a
                    href="https://github.com/naditya98"
                    target="_blank"
                    rel="noopener noreferrer"
                > Aditya ❤ Ankita ❤ Anubhav </a>
                <br/>

            </p>
        </footer>
    );
};

export default Footer
